import { useEffect } from "react";
import { useParams } from "react-router-dom"
import { getContent} from "../Service/getContent"

export function DetailsPage() {

    const {id} = useParams();
    const urlContentDetailed ="/search/multi/"+id+"/api_key=3&language=en-US&page=1&include_adult=false"
    
    useEffect(()=>{
        const response = getContent (urlContentDetailed).then((response) => {
        let data = response.data;
            console.log(data);
        }); 
      },[]);

  return (
    <div >DetailsPage</div>
  )
}
